  effects on the acoustic signals and behavior of Southern Resident killer whales
  (Orcinus orca)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 5,\n\t\t\"recent\":
  3\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-03-21T22:51:18.666999\",\n\t\"name\": \"srkw-acoustic-response-investigating-noise-effects-on-the-acoustic-signals-and-behavior-of-sout\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In this study, vocal compensation is being
  investigated in Southern Resident killer whale (SRKW) calls to determine the degree
  to which whales can adjust to increased background noise levels. In addition, whale
  and vessel behavior data are also collected to determine what contribution vessel
  traffic has on noise levels and how noise levels influence whale behavior. The work
  was part of an NRC-postdoctoral project led by Marla Holt, and includes Dawn Noren
  (Adams) and Candice Emmons as internal collaborators. The specific work includes
  experimental design, data collection, data analysis, and writing for submission
  to peer-reviewed journals. This is a one-time project, and addresses key risk factors
  (vessel and noise interactions) of SRKW.nnMeasurements of vocal behavior, whale
  behavioral states, background noise measurements, vessel counts and other attributes.\",\n\t\"license_title\":
